$('.toggle_btn').click(function () {
    $(this).siblings('.qoute').toggleClass('active');
});

$('.filter-btn').click(function () {
    $('.filter-btn').removeClass('active');
    $(this).addClass('active');
    pause_all_video();
});

$('.parent-business-type').click(function () {
    if ($(this).siblings('.div-block-11').hasClass('active') == true) {
        $('.div-block-11').removeClass('active');
    } else {
        $('.div-block-11').removeClass('active');
        $(this).siblings('.div-block-11').addClass('active')
    }
});

$(".collection-item-2").each(function (index) {
    var current_video_id = "" + $(this).children('.brand-card').children('.meta-data').children('.meta-video').html();
    //alert(current_video_id);

    _wq.push({
        id: current_video_id, onReady: function (video) {
            video.bind("play", function () {
                $(".collection-item-2").each(function (i) {
                    var video_id = "" + $(this).children('.brand-card').children('.meta-data').children('.meta-video').html();

                    if (video_id != current_video_id) {
                        _wq.push({
                            id: video_id, onReady: function (video) {
                                video.pause();
                            }
                        });
                    }
                });
            });
        }
    });
});

$(".collection-item-2").each(function () {
    var meta_subtype = $(this).children(".brand-card").children(".meta-data").children(".meta-business-subtype").html();
    var meta_maintype = $(this).children(".brand-card").children(".meta-data").children(".meta-business-maintype").html();
    var meta_size = $(this).children(".brand-card").children(".meta-data").children(".meta-size").html();
    var meta_region = $(this).children(".brand-card").children(".meta-data").children(".meta-region").html();

    $(this).attr("data-subtype", "" + meta_subtype);
    $(this).attr("data-maintype", "" + meta_maintype);
    $(this).attr("data-size", "" + meta_size);
    $(this).attr("data-region", "" + meta_region);
});


function removeArray(arr) {
    var what, a = arguments, L = a.length, ax;
    while (L > 1 && arr.length) {
        what = a[--L];
        while ((ax = arr.indexOf(what)) !== -1) {
            arr.splice(ax, 1);
        }
    }
    return arr;
}

var sub_item_array = [];
var region_array = [];
var size_array = [];


$('.sub_item').click(function () {
    var sub_item = $(this).children('.text-block-6').html();

    if ($(this).hasClass("active") == false) {
        $(this).addClass("active");
        sub_item_array.push(sub_item);
    } else {
        $(this).removeClass("active");
        removeArray(sub_item_array, sub_item);
    }
    filter_items();
});


$('.map div').click(function () {
    var region = $(this).attr("data-region");

    if ($(this).hasClass("active") == false) {
        $(this).addClass("active");
        region_array.push(region);
    } else {
        $(this).removeClass("active");
        removeArray(region_array, region);
    }
    filter_items();
});

$('.size-bar-btn').click(function () {
    var size = $(this).attr("data-size");

    if ($(this).hasClass("active") == false) {
        $(this).addClass("active");
        size_array.push(size);
    } else {
        $(this).removeClass("active");
        removeArray(size_array, size);
    }
    filter_items();
});

function filter_items() {
    $(".collection-item-2").hide();

    //Biggest size of customer
    var heightest_size_array = [];
    $(".collection-item-2").each(function () {
        var size_var = $(this).attr("data-size");
        heightest_size_array.push(parseInt(size_var));
    });

    var largest = 0;
    for (i = 0; i <= largest; i++) {
        if (heightest_size_array[i] > largest) {
            var largest = heightest_size_array[i];
        }
    }


    if (sub_item_array.length != 0) {
        sub_item_array.forEach(function (value) {
            if (region_array.length != 0) {
                region_array.forEach(function (value2) {
                    if (size_array.length != 0) {
                        size_array.forEach(function (value3) {
                            if (value3 == "10") {
                                var i;
                                for (i = 0; i < 10; i++) {
                                    $(".collection-item-2[data-subtype='" + value + "'][data-region='" + value2 + "'][data-size='" + i + "']").show();
                                }
                            } else if (value3 == "10-20") {
                                var j;
                                for (j = 10; j <= 20; j++) {
                                    $(".collection-item-2[data-subtype='" + value + "'][data-region='" + value2 + "'][data-size='" + j + "']").show();
                                }
                            } else if (value3 == "20-50") {
                                var k;
                                for (k = 21; k <= 50; k++) {
                                    $(".collection-item-2[data-subtype='" + value + "'][data-region='" + value2 + "'][data-size='" + k + "']").show();
                                }
                            } else if (value3 == "50") {
                                var l;
                                for (l = 51; l <= largest; l++) {
                                    $(".collection-item-2[data-subtype='" + value + "'][data-region='" + value2 + "'][data-size='" + l + "']").show();
                                }
                            }
                        });
                    } else {
                        $(".collection-item-2[data-subtype='" + value + "'][data-region='" + value2 + "']").show();
                    }
                });
            } else {
                if (size_array.length != 0) {
                    size_array.forEach(function (value3) {
                        if (value3 == "10") {
                            var i;
                            for (i = 0; i < 10; i++) {
                                $(".collection-item-2[data-subtype='" + value + "'][data-size='" + i + "']").show();
                            }
                        } else if (value3 == "10-20") {
                            var j;
                            for (j = 10; j <= 20; j++) {
                                $(".collection-item-2[data-subtype='" + value + "'][data-size='" + j + "']").show();
                            }
                        } else if (value3 == "20-50") {
                            var k;
                            for (k = 21; k <= 50; k++) {
                                $(".collection-item-2[data-subtype='" + value + "'][data-size='" + k + "']").show();
                            }
                        } else if (value3 == "50") {
                            var l;
                            for (l = 51; l <= largest; l++) {
                                $(".collection-item-2[data-subtype='" + value + "'][data-size='" + l + "']").show();
                            }
                        }
                    });
                } else {
                    $(".collection-item-2[data-subtype='" + value + "']").show();
                }
            }
        });
    } else {
        if (size_array.length != 0) {
            size_array.forEach(function (value3) {
                if (region_array.length != 0) {
                    region_array.forEach(function (value4) {
                        if (value3 == "10") {
                            var i;
                            for (i = 0; i < 10; i++) {
                                $(".collection-item-2[data-region='" + value4 + "'][data-size='" + i + "']").show();
                            }
                        } else if (value3 == "10-20") {
                            var j;
                            for (j = 10; j <= 20; j++) {
                                $(".collection-item-2[data-region='" + value4 + "'][data-size='" + j + "']").show();
                            }
                        } else if (value3 == "20-50") {
                            var k;
                            for (k = 21; k <= 50; k++) {
                                $(".collection-item-2[data-region='" + value4 + "'][data-size='" + k + "']").show();
                            }
                        } else if (value3 == "50") {
                            var l;
                            for (l = 51; l <= largest; l++) {
                                $(".collection-item-2[data-region='" + value4 + "'][data-size='" + l + "']").show();
                            }
                        }
                    });
                }
                else {
                    if (value3 == "10") {
                        var i;
                        for (i = 0; i < 10; i++) {
                            $(".collection-item-2[data-size='" + i + "']").show();
                        }
                    } else if (value3 == "10-20") {
                        var j;
                        for (j = 10; j <= 20; j++) {
                            $(".collection-item-2[data-size='" + j + "']").show();
                        }
                    } else if (value3 == "20-50") {
                        var k;
                        for (k = 21; k <= 50; k++) {
                            $(".collection-item-2[data-size='" + k + "']").show();
                        }
                    } else if (value3 == "50") {
                        var l;
                        for (l = 51; l <= largest; l++) {
                            $(".collection-item-2[data-size='" + l + "']").show();
                        }
                    }
                }

            });
        } else if (region_array.length != 0) {
            region_array.forEach(function (value2) {
                $(".collection-item-2[data-region='" + value2 + "']").show();
            });
        } else {
            $(".collection-item-2").show();
        }
    }
}


$('.reset-filter').click(function () {
    $('.size-bar-btn').removeClass("active");
    $('.sub_item').removeClass("active");
    $('.map div').removeClass("active");
    $('.filter-btn').removeClass("active");
    $('.div-block-11').removeClass('active');
    sub_item_array = [];
    region_array = [];
    size_array = [];
    $(".collection-item-2").show();
    pause_all_video();
});

function pause_all_video() {
    $(".collection-item-2").each(function (i) {
        var video_id = "" + $(this).children('.brand-card').children('.meta-data').children('.meta-video').html();
        _wq.push({
            id: video_id, onReady: function (video) {
                video.pause();
            }
        });
    });
}

if ($(window).width() < 600) {
    $('.collection-item:nth-child(1) .text-block-5').addClass('active');
    $('.collection-item:nth-child(1) .div-block-11').addClass('active');
    $('.collection-item').click(function () {
        $('.text-block-5').removeClass('active');
        $(this).children('.text-block-5').addClass('active');
        $('.div-block-11').removeClass('active');
        $(this).children('.div-block-11').addClass('active');
    });
}



